import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from "react-router-dom";
import App from './App';
import './index.css';



const ITEMTYPES = [
  {"type": ["Breakfast", "Lunch", "Dinner", "Snack", "Other"]}

]



ReactDOM.render(
<BrowserRouter>
<App 
   itemTypes = {ITEMTYPES}
  />
  </BrowserRouter>, document.getElementById('root'));
